webpackJsonp([66308157163162],{499:function(t,n){t.exports={data:{markdownRemark:{html:'<p>binstd以程序员为核心建设技术信用,对开发者实现数据化的了解，理解。推动开发生态建设，建立技术生态底层的公用数据服务资源，区块链跨链云服务;发行技术生态标准数字资产STD。成为技术落地的最后一公里，引领开发潮流。\n<img src="https://ws4.sinaimg.cn/large/006tKfTcgy1ftjtbu2fuej30w60lawf1.jpg"></p>\n<p><strong>跨链云服务</strong>\n建立区块链云服务平台，支持多个公链网络的跨链层建设，多种语言的封装服务。逐步建设跨链 基础链和状态数据链。</p>\n<p><strong>公用资源服务及工具</strong>\n打造程序(框架/库)、数据(云数据 API)的公用服务资源平台，实现开发能力和数据能力的组 件化、插件化、云端化，让开发变得更为简单。</p>\n<p>提供版本控制系统、IDE、聊天/协作/Bug问题追踪、持续集成与交付部署与容器等云端工具服 务，为程序员创造便捷的线上协作开发体验。</p>\n<p><strong>翻译计划</strong>\n推动优质区块链技术普及，建设技术开发生态和开发者社群。</p>',frontmatter:{date:"July 12, 2017",path:"/info",title:"关于我们"}}},pathContext:{}}}});
